import { Card } from "react-bootstrap"

interface BudgetProps {
  name: string,
  amount: number,
  max: number
}

export default function BudgetCard( {name, amount, max}: BudgetProps) {
  return (
    <Card>
      <Card.Body>
        <Card.Title>
          <div>{name}</div>
          <div>{amount}/{max}</div>
        </Card.Title>
      </Card.Body>
    </Card>
  )
}
